script: |
  super -f text -I q12604.spq | sort > q12604.out

inputs:
  - name: q12604.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT + col0 NOT BETWEEN + - 13 AND col1 * + - col0 * - 64 + + + col2 - - - col0;
  - name: tab0

outputs:
  - name: q12604.out
    data: |
      15	81	47
      87	21	10
      97	1	99
